g Kampong Mumong at night. The crocodile emerged during a heavy rain, however, there was no injuries reported due to the crocodile.<br>#Mediapermata<br></td></tr><tr style='height:19px;'><th id="1303182445R4" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">5</div></th><td class="s0">5</td><td class="s0">21/1/2014</td><td class="s2">Belait District is experiencing flood again</td></tr><tr style='height:19px;'><th id="1303182445R5" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">6</div></th><td class="s0">6</td><td class="s0">21/1/2014</td><td class="s2">Continuous rain since last night has caused a flash flood in a few low land areas in Belait District and Seria.</td></tr><tr style='height:19px;'><th id="1303182445R6" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">7</div></th><td class="s0">7</td><td class="s0">21/1/2014</td><td class="s2">Some of the roads heading towards the private residences and school areas are submerged in water. This causes some of the road users difficulties and some cars are stuck there due to the damages made by the flood.</td></tr><tr style='height:19px;'><th id="1303182445R7" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">8</div></th><td class="s0">8</td><td class="s0">21/1/2014</td><td class="s2">The students in SOAS Primary School Kuala Belait has to go across the rising water. The school was so badly affected by the flood that the school has to be moved temporarily to a different school as to not affect the students’ educations.</td></tr><tr style='height:19px;'><th id="1303182445R8" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">9</div></t