noon, had to divert many times ... the normal &quot;shortcut&quot; to Sg Lurah is impassable to sedans and even SUVs. Am now in Lawas on the way to KK, coming back about 3 days&#39; time. If help is still needed then, count me in. I&#39;m driving Defender HCPU. +60192219244</div></td></tr><tr style='height:19px;'><th id="1303182445R30" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">31</div></th><td class="s0">31</td><td class="s0">22/1/2014</td><td class="s2">call me at 8739779 if someone needs volunteer </td></tr><tr style='height:159px;'><th id="1303182445R31" style="height: 159px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 159px;">32</div></th><td class="s0">32</td><td class="s0">23/1/2014</td><td class="s3">People in Belait are worried<br>By Hajah Saemah Zulkefli<br><br>A number of people in Jalan Mumong are worried with the continuous rain occurring in their area which has cause a few flash floods especially at low-land areas.<br>One of the occupants in Jalan Mumong has informed that water has entered their house due to continuous rain lately. The homeowner, Awang Raman, stated that the water due to the flash flood has caused some of their household properties are damaged. He said that one of the reasons flash flood occurs in their area are due to the sewage system in the sewer that does not allow water to flow through easily.<br>“Water entered our house due to the flash flood. The water has risen to our thighs. Other than the properties being damaged, we are concerned with our safety as there has been sightings of crocodiles,” said Awang Raman.<br></td></tr><tr style='height:19px;'><th id="1303182445R32" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">33</div></th><td class="s0">33</td><td class="s0">23/1/2014</td><td class="s2">Jalan Tengah Seria, Jalan Panaga until Pekan Belait are experiencing flash floods as of this early morning.</td></tr><tr style='height:19px;'><th id="1303182445R33" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">34</div></th><td class="s0">34</td><td class="s0">23/1/2014</td><td class="s2">Continuous rain since 7:00PM last night</td></tr><tr style='height:19px;'><th id="1303182445R34" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">35</div></th><td class="s0">35</td><td class="s0">23/1/2014</td><td class="s2">Need to keep an eye on the children... worried about the crocodiles</td></tr><tr style='height:179px;'><th id="1303182445R35" style="height: 179px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 179px;">36</div></th><td class="s0">36</td><td class="s0">23/1/2014</td><td class="s3">FLOODS and landslides wreaked havoc across the country yesterday, following two days of rain.<br>The Brunei-Muara District Disaster Management Committee (DDMC) reported 44 cases of landslides in the district, including one near several foreign diplomatic missions at Jalan Kedutaan.<br>Eight houses around the areas of Kg Lugu, Kg Lambak, Kg Subok, Kg Jerudong and Sg Tilong were badly affected, a committee member told The Brunei Times.<br>The committee member, who did not want to be named, said residents were advised to evacuate their houses due to the landslides.<br>However, he said some residents preferred to stay in their houses.<br>No details were given on the number of residents who were affected by the floods.<br>The Brunei-Muara DDMC involves 30 agencies, including the Brunei-Muara District Office, Fire and Rescue Department, Royal Brunei Police Force and Internal Security Department.<br>The committee operates 24 hours. Any reports of landslides or floods can be made through its hotline 2380804.<br></td></tr><tr style='height:59px;'><th id="1303182445R36" style="height: 59px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 59px;">37</div></th><td class="s0">37</td><td class="s0">23/1/2014</td><td class="s3">State broadcaster Radio Televisyen Brunei (RTB) last night reported flooded areas in Mukim Pengkalan Batu.<br>In Tutong district, RTB reported that Mukim Lamunin, Mukim Rambai, Mukim Tanjong Maya and Mukim Ukong were among the areas worst hit by floods.<br></td></tr><tr style='height:19px;'><th id="1303182445R37" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">38</div></th><td class="s0">38</td><td class="s0">23/1/2014</td><td class="s1 softmerge"><div class="softmerge-inner" style="width: 1842px; left: -1px;">A family in Kampung Penapar was moved to a temporary shelter at the Kampung Tanjong Maya Mosque. The Tutong District Disaster Management Committee used the village’s Civic Centre and mosque as temporary relief centres for flood victims.</div></td></tr><tr style='height:79px;'><th id="1303182445R38" style="height: 79px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 79px;">39</div></th><td class="s0">39</td><td class="s0">23/1/2014</td><td class="s3">Floods in Belait are in Kampung Sungai Mau, Jalan Bukit Puan, Kampung Singap and Kampung Laid Lakang, Jalan Setia Diraja, Jalan Jaya Negara, Jalan Puteri Brunei, Jalan Panglima, Jalan Singa Menteri and Jalan Sungai Pandai, the National Disaster Management Centre spokesperson said.<br>He said floodwater level readings reached 1.04mm in Belait yesterday.<br></td></tr><tr style='height:19px;'><th id="1303182445R39" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">40</div></th><td class="s0">40</td><td class="s0">23/1/2014</td><td class="s2">The Temburong District Office said there was flooding in Mukim Bokok on Tuesday night.</td></tr><tr style='height:19px;'><th id="1303182445R40" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">41</div></th><td class="s0">41</td><td class="s0">23/1/2014</td><td class="s2">Flood water level has risen 1.05 metre in the area of Jalan Mukim Bukit Sawat yesterday.</td></tr><tr style='height:19px;'><th id="1303182445R41" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">42</div></th><td class="s0">42</td><td class="s0">23/1/2014</td><td class="s2">Several areas in the Brunei- Muara District have been affected by floods following heavy rains since last night.</td></tr><tr style='height:19px;'><th id="1303182445R42" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">43</div></th><td class="s0">43</td><td class="s0">23/1/2014</td><td class="s2">heard of 24 hr raining but experiencing for the first time ......prey for flood affected people in tutong and kb districts may god help them to face advarsity and come out safely</td></tr><tr style='height:19px;'><th id="1303182445R43" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">44</div></th><td class="s0">44</td><td class="s0">23/1/2014</td><td class="s2">heard it was heavy raining yesterday</td></tr><tr style='height:19px;'><th id="1303182445R44" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">45</div></th><td class="s0">45</td><td class="s0">23/1/2014</td><td class="s2">What VHF frequency? 9W8PSI</td></tr><tr style='height:19px;'><th id="1303182445R45" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">46</div></th><td class="s0">46</td><td class="s0">24/1/2014</td><td class="s2">Any flash floods or landslides happening, must be reported to the Search and Rescue Department by calling the emergency hotline 995 or National Disaster Management Centre Hotline 2380354, 2380324 or 2380308.</td></tr><tr style='height:199px;'><th id="1303182445R46" style="height: 199px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 199px;">47</div></th><td class="s0">47</td><td class="s0">24/1/2014</td><td class="s3">136 houses in Tutong affected<br>By Ak Fairol RMF<br><br>Following the heavy rain that cause flooding in a few areas in Brunei Darussalam especially in Tutong and Belait District.<br>The government has made steps to help the victims affected that needs the help that they needed.<br>This morning, the Minister of Ministry of Home Affairs, Yang Dimuliakan Pehin Udana Khatib Dato Paduka Seri Setia Ustaz Haji Awang Badaruddin bin Pengarah Dato Paduka Haji Othman made a visit to a temporary placement at Kampong Tanjong Maya Mosque and Dewan Kemasyarakatan Tanjong Maya to visit the victims of the flood in Tutong district.<br>So far, houses that are affected in Tutong district recorded are 136 houses, 46 out of them are in Kampong Tanjong Maya, 33 are from Kampong Lubok Pulou, 47 are from Kampung Penapar and 10 more are in Kampong Bukit Udal.<br>#Mediapermata<br></td></tr><tr style='height:79px;'><th id="1303182445R47" style="height: 79px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 79px;">48</div></th><td class="s0">48</td><td class="s0">24/1/2014</td><td class="s3">INFORMATION: Temporary Placement for students of Sekolah Rendah Panaga<br>Following the flooding situation at the premises of Sekolah Rendah Panaga, Seria, Ministry of Education worked together with Ministry of Religious Affairs to inform the students that the school has been momentarily shifted to Sekolah Ugama Pengiran Anak Puteri Rashidah Sa’adatul Bolkiah.<br></td></tr><tr style='height:19px;'><th id="1303182445R48" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">49</div></th><td class="s0">49</td><td class="s0">24/1/2014</td><td class="s1 softmerge"><div class="softmerge-inner" style="width: 2062px; left: -1px;">Residences that are heavily affected by the flood are in Tutong district, Mukim Bukit Sawat dan Mukim Labi;  Kampung Bukit Sawat, Kampung Sungai Mau, Kampung Laid Lakang, Kampung Singap, Kampung Merangking Hilir, Rumah Panjang Melayan and Pos Polis Bukit Puan.</div></td></tr><tr style='height:19px;'><th id="1303182445R49" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">50</div></th><td class="s0">50</td><td class="s0">24/1/2014</td><td class="s2">In Kampung Bukit Sawat is recorded to have a 1.5 metre water level.</td></tr><tr style='height:19px;'><th id="1303182445R50" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">51</div></th><td class="s0">51</td><td class="s0">24/1/2014</td><td class="s2">The authorities have identified that as much as 158 people are living in the risky zone at Mukim Bukit Sawat and Mukim Labi, in which the authorities are ready to move these people to a safer plac.</td></tr><tr style='height:19px;'><th id="1303182445R51" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">52</div></th><td class="s0">52</td><td class="s0">24/1/2014</td><td class="s2">Datin Hajah Adina said that JAPEM is ready to supply food and other necessities to the victims of flood in the Belait District.</td></tr><tr style='height:19px;'><th id="1303182445R52" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">53</div></th><td class="s0">53</td><td class="s0">24/1/2014</td><td class="s2">At the moment food and water supplies are distributed to areas in Belait that are cut off due to the flood that covered the road.</td></tr><tr style='height:19px;'><th id="1303182445R53" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">54</div></th><td class="s0">54</td><td class="s0">24/1/2014</td><td class="s2">Residents living along the riverbank of Kampung Sungai Mau had to use a boat to move around from their houses ever since the continuous rain.</td></tr><tr style='height:59px;'><th id="1303182445R54" style="height: 59px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 59px;">55</div></th><td class="s0">55</td><td class="s0">24/1/2014</td><td class="s3">DST has issued a statement apologising for disrupted 2G and 3G services to mobile and broadband services in Tutong and Belait districts.<br>The statement explains that disruptions were due to a landslide in the Jerudong area following heavy rain, which led to the cut of DST’s main fibre optic link, affecting transmission links to the Belait and Tutong District.<br>DST reassures that it has made it a top priority to recover the transmission links and monitor the coverage areas of its networks. - Syazwana Souyono</td></tr><tr style='height:19px;'><th id="1303182445R55" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">56</div></th><td class="s0">56</td><td class="s0">24/1/2014</td><td class="s2">Continuous heavy rain for the past two days have caused landslides and floods in low-land areas in this country.</td></tr><tr style='height:19px;'><th id="1303182445R56" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper"